(function horizonImageLoader(cs) {
  
  "use strict";
  var sliceArray = [];
  sliceArray[0] = "";
  sliceArray[1] = "";
  sliceArray[2] = "";
  sliceArray[3] = "";
  sliceArray[4] = "";
  sliceArray[5] = "";
  sliceArray[6] = "";
  sliceArray[7] = "";
  sliceArray[8] = "";
  sliceArray[9] = "";
  sliceArray[10] = "";
  sliceArray[11] = "";
  sliceArray[12] = "";
  sliceArray[13] = "";
  sliceArray[14] = "";
  sliceArray[15] = "";
  sliceArray[16] = "";
  sliceArray[17] = "";
  sliceArray[18] = "";
  sliceArray[19] = "";
  sliceArray[20] = "";
  sliceArray[21] = "";
  sliceArray[22] = "";

  var minPixelValue = 0;
  var maxPixelValue = 611;
  var windowCenter = 127;
  var windowWidth = 256;
  var rows = 256;
  var columns = 256;
  var slices = sliceArray.length;
  var columnPixelSpacing = 0.78125;
  var rowPixelSpacing = 0.78125;
  var slicePixelSpacing = 6.5;
  
  var imageArrayY = [];
  var imageArrayZ = [];
  
  function str2ab(str) {
    var buf = new ArrayBuffer(str.length*2); // 2 bytes for each char
    var bufView = new Uint16Array(buf);
    var index = 0;
    for (var i=0, strLen=str.length; i<strLen; i+=2) {
      var lower = str.charCodeAt(i);
      var upper = str.charCodeAt(i+1);
      bufView[index] = lower + (upper <<8);
      index++;
    }
    return bufView;
  }

  function getImageX(imageId) {
    var iid = imageId.split("//")[1];
    
    function getPixelData() {
      iid = imageId.split("//")[1];
      var pixelDataAsString = window.atob(sliceArray[iid]);
      var pixelData = str2ab(pixelDataAsString);
      return pixelData;
    }

    var image = {
      imageId: imageId,
      minPixelValue : minPixelValue,
      maxPixelValue : maxPixelValue,
      slope: 1.0,
      intercept: 0,
      windowCenter : windowCenter,
      windowWidth : windowWidth,
      render: cornerstone.renderGrayscaleImage,
      getPixelData: getPixelData,
      rows: rows,
      columns: columns,
      height: rows,
      width: columns,
      color: false,
      columnPixelSpacing: columnPixelSpacing,
      rowPixelSpacing: rowPixelSpacing,
      sizeInBytes: columns * rows * 2
    };

    var deferred = $.Deferred();
    deferred.resolve(image);
    return deferred;
  }

  
  // TODO this could be implemented in getDicomImage as the imageID should include the loader
  function getImageY(imageId) {
    var iid = imageId.split("//")[1];
    
    function getPixelData()
    {
      iid = imageId.split("//")[1];
      return imageArrayY[iid];
    };

    var image = {
      imageId: imageId,
      minPixelValue : minPixelValue,
      maxPixelValue : maxPixelValue,
      slope: 1.0,
      intercept: 0,
      windowCenter : 257,
      windowWidth : 512,
      render: cornerstone.renderGrayscaleImage,
      getPixelData: getPixelData,
      rows: slices,
      columns: rows,
      height: slices,
      width: rows,
      color: false,
      columnPixelSpacing: rowPixelSpacing,
      rowPixelSpacing: slicePixelSpacing,
      sizeInBytes: rows * slices * 2
    };

    var deferred = $.Deferred();
    deferred.resolve(image);
    return deferred;
  }
  
  function getImageZ(imageId) {
    var iid = imageId.split("//")[1];
    
    function getPixelData()
    {
      iid = imageId.split("//")[1];
      return imageArrayZ[iid];
    };

    var image = {
      imageId: imageId,
      minPixelValue : minPixelValue,
      maxPixelValue : maxPixelValue,
      slope: 1.0,
      intercept: 0,
      windowCenter : 257,
      windowWidth : 512,
      render: cornerstone.renderGrayscaleImage,
      getPixelData: getPixelData,
      rows: slices,
      columns: columns,
      height: slices,
      width: columns,
      color: false,
      columnPixelSpacing: rowPixelSpacing,
      rowPixelSpacing: slicePixelSpacing,
      sizeInBytes: columns * slices * 2
    };

    var deferred = $.Deferred();
    deferred.resolve(image);
    return deferred;
  }
  
  
  
  function getPixelDataR(i) {
      var pixelDataAsString = window.atob(sliceArray[i]);
      var pixelData = str2ab(pixelDataAsString);
      return pixelData;
    }
  
  function rotateCube() {
  
    var cubeX = [];
    var width = columns;
    var height = rows;
    
    // Convert ajax response string to 3D cube
    for( var i=0; i<slices; i++) { 
      // Get slice which is stored as one dimensional array
      var sliceAsString = [];
      sliceAsString = getPixelDataR(i);

      // Convert to two dimensional array
      var index = 0;
      var sliceUnrotated = [];
      for (y=0; y<height; y++) {
        sliceUnrotated[y] = [];
        for (x=0; x<width; x++) {
          sliceUnrotated[y][x] = sliceAsString[index];
          index++;
        }
      }
      cubeX[i] = sliceUnrotated;
    }  

    // Rotate the cube in one direction
    var cubeY = [];
    for(var z=0; z<cubeX[0][0].length; z++) {
      cubeY[z] = [];
      for(var y=0; y<cubeX.length; y++) {
        cubeY[z][y] = [];
        for(var x=0; x<cubeX[0].length; x++) {
          cubeY[z][y][x] = cubeX[y][x][z];
        }
      }
    }
    // Rotate the cube in the other direction
    var cubeZ = [];
    for(var z=0; z<cubeX[0].length; z++) {
      cubeZ[z] = [];
      for(var y=0; y<cubeX.length; y++) {
        cubeZ[z][y] = [];
        for(var x=0; x<cubeX[0][0].length; x++) {
          cubeZ[z][y][x] = cubeX[y][z][x];
        }
      }
    }

    // Convert Y cube to string array
    for (var z=0; z<cubeY.length; z++) {
      var sliceArray = [];
      index = 0;
      for (y=(cubeY[0].length-1); y>=0; y--) {
        for (x=0; x<cubeY[0][0].length; x++) {
          sliceArray[index] = cubeY[z][y][x]
          index++;
        }
      }
      imageArrayY[z] = sliceArray;
    }
    // Convert Z cube to string array
    for (var z=0; z<cubeZ.length; z++) {
      var sliceArray = [];
      index = 0;
      for (y=(cubeZ[0].length-1); y>=0; y--) {
        for (x=0; x<cubeZ[0][0].length; x++) {
          sliceArray[index] = cubeZ[z][y][x]
          index++;
        }
      }
      imageArrayZ[z] = sliceArray;
    }

  }
  
  rotateCube();
  
  // register our imageLoader plugin with cornerstone
  cs.registerImageLoader('viewX', getImageX);
  cs.registerImageLoader('viewY', getImageY);
  cs.registerImageLoader('viewZ', getImageZ);

}(cornerstone));